/**
 * @file
 * A JavaScript file for the theme.
 *
 * In order for this JavaScript to be loaded on pages, see the instructions in
 * the README.txt next to this file.
 */

// JavaScript should be made compatible with libraries other than jQuery by
// wrapping it with an "anonymous closure". See:
// - https://drupal.org/node/1446420
// - http://www.adequatelygood.com/2010/3/JavaScript-Module-Pattern-In-Depth
(function ($, Drupal) {
  // To understand behaviors, see https://drupal.org/node/756722#behaviors
  Drupal.behaviors.slick = {
    attach: function (context, settings) {
      $(this).once('scripts').each(function() {
        /**
         * Mobile hamburger menu
         * @return {[type]} [description]
         */

        $(".slider").slick({
          autoplay: true,
          autoplaySpeed: 5000,
          arrows: false,
          fade: true,
          cssEase: "linear",
          draggable: false,
          accessibility: false,
          pauseOnHover: false,
          pauseOnFocus: false,
          infinite: true,
          adaptiveHeight: false,
        });

        $(".for-slider").slick({
          autoplay: true,
          autoplaySpeed: 5000,
          arrows: false,
          fade: true,
          cssEase: "linear",
          asNavFor: ".slider",
          draggable: false,
          accessibility: false,
          pauseOnHover: false,
          pauseOnFocus: false,
          adaptiveHeight: false,
          infinite: true,
        });

        function slickify() {
          $(".slider-for-news").slick({
            autoplay: true,
            autoplaySpeed: 5000,
            slidesToShow: 1,
            slidesToScroll: 1,
            arrows: false,
            fade: true,
            asNavFor: ".slider-nav-news",
            adaptiveHeight: false,
            responsive: [
              {
                breakpoint: 1024,
                settings: "unslick",
              },
            ],
          });
          $(".slider-nav-news").slick({
            slidesToShow: 3,
            slidesToScroll: 1,
            asNavFor: ".slider-for-news",
            arrows: false,
            dots: false,
            centerMode: false,
            focusOnSelect: true,
            adaptiveHeight: false,
            responsive: [
              {
                breakpoint: 1024,
                settings: "unslick",
              },
            ],
          });
        }
        slickify();
        $(window).resize(function () {
          var $windowWidth = $(window).width();
          if ($windowWidth > 1024) {
            slickify();
          }
        });

        //example here https://codepen.io/antishock/pen/JaagGz **
        //ticking machine
        var percentTime;
        var tick;
        var progressBarIndex = 0;

        function startProgressbar() {
          resetProgressbar();
          percentTime = 0;
          tick = setInterval(interval, 10);
        }

        function interval() {
          if ($('.slider .slick-track div[data-slick-index="' + progressBarIndex + '"]' ).attr("aria-hidden") === "true") {
            progressBarIndex = $('.slider .slick-track div[aria-hidden="false"]' ).data("slickIndex");
            startProgressbar();

          } else {
            $(".progress-index-" + progressBarIndex).attr(
              "data-progress",
              Math.round(percentTime)
            );

            percentTime += 0.19;

            if (percentTime >= 100) {
              $(".homepage-hero-wrapper").slick("slickNext");
              $(".for-slider").slick("slickNext");
              progressBarIndex++;
              if (progressBarIndex > 2) {
                progressBarIndex = 0;
              }
              startProgressbar();
            }
          }
        }

        function resetProgressbar() {
          $(".progress-circle").attr("data-progress", '0');
          clearInterval(tick);
        }
        startProgressbar();
        // End ticking machine

        $(".item").click(function () {
          clearInterval(tick);
          var goToThisIndex = $(this).find("div").data("slickIndex");
          $(".homepage-hero-wrapper").slick("slickGoTo", goToThisIndex, false);
          $(".for-slider").slick("slickGoTo", goToThisIndex, false);
          startProgressbar();
        });

      })
    }
  };

})(jQuery, Drupal);;
